GUID_TABLE_BYTES = {}

def get_bytes_from_guid(guid):
    guid = guid[5:-1]
    parts = [int(_,16) for _ in guid.split(",")]
    f = parts[0]
    f1, f2, f3, f4 = (f & 0xFF, (f>>8) & 0xFF, (f>>16) & 0xFF, (f>>24) & 0xFF)
    g = parts[1]
    g1, g2 = (g & 0xFF, (g>>8) & 0xFF)
    h = parts[2]
    h1, h2 = (h & 0xFF, (h>>8) & 0xFF)
    parts.pop(0)
    parts.pop(0)
    parts.pop(0)
    guid = [f1,f2,f3,f4,g1,g2,h1,h2] + parts
    return guid
    

def fill_GUID_TABLE_BYTES_():
    for prot, guid in GUID_TABLE.items():
        GUID_TABLE_BYTES[prot] = get_bytes_from_guid(guid)


def print_guid(guid):
    data = "GUID("
    part1 = struct.unpack("<I", guid[0:4])[0]
    data += "{:#08x},".format(part1)
    part2 = struct.unpack("<H", guid[4:6])[0]
    data += "{:#04x},".format(part2)
    part3 = struct.unpack("<H", guid[6:8])[0]
    data += "{:#04x},".format(part3)
    data += ",".join(["{:#02x}".format(ord(_)) for _ in guid[8:]])
    data += ")"
    return data

def assign_EFI_GUIDS_in_data_region():
    segm = idaapi.get_segm_by_name(".data")
    #start = segm.start_ea
    #end   = segm.end_ea
    start = segm.startEA
    end   = segm.endEA
    # We assume it is all aligned to 16
    for addr in range(start, end, 16):
        potential_guid = [int("{:02x}".format(ord(_)),16) for _ in idc.GetManyBytes(addr, 16)]
        for prot, guid in GUID_TABLE_BYTES.items():           
            if potential_guid == guid:
                assign_struct_to_address(addr, "GUID")
                idc.MakeName(addr, prot)

